import { BrowserRouter as Router, Routes, Route} from "react-router-dom";
import MainPage from "./MainPage/MainPage";

const RouterComponent = ():JSX.Element => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<MainPage/>}/>
            </Routes>
        </Router>
    );
};

export default RouterComponent;
